import React from "react";

function Filter(props){
   
    let filterData=props.filterData; 
   // val.map((value) => console.log(value))
    //console.log(val);

    return (
        <div className=" flex  justify-center align-center my-5">  
        {
            filterData.map((key=ddata)=> (    
               <button  className="bg-transparent hover:bg-blue-500 text-blue-600  hover:text-white px-1 border border-blue-500 hover:border-transparent rounded mx-2 ">
                {data.title}
                </button>
              )
               
             )
        }
        </div>
    )
}

export default Filter;
